body, .default {
  font-family: "Merriweather", "Georgia", serif;
  color: #212931;
  font-size: 100%;
  font-weight: 300;
  line-height: 1.65;
  text-align: justify;
}

a, .link {
  color: #212931;
  text-decoration: underline dotted;
  transition: all 300ms ease-in-out;
}
a:hover, .link:hover {
  color: #18bfef;
  text-decoration: none;
}

hr, .hr {
  height: 2px;
  background: #e7e7e7;
  border: none;
  margin: 3rem 0;
}

blockquote, .blockquote {
  border-left: #e7e7e7 4px solid;
  font-style: italic;
  margin: 0 0 2rem 0;
  padding: 0.5rem 0 0.5rem 2rem;
}

code, .code {
  color: #212931;
  background: #f6f6f6;
  padding: 0.3em;
  border: #f6f6f6 1px solid;
}

.subtitle-italic-1 {
  font-family: "Merriweather", "Georgia", serif;
  font-size: 1rem;
  font-style: italic;
  margin: 0 0 2rem 0;
}

.subtitle-italic-2 {
  font-family: "Merriweather", "Georgia", serif;
  font-size: 0.9rem;
  font-style: italic;
  margin: 0 0 2rem 0;
}

.subtitle-italic-3 {
  font-family: "Merriweather", "Georgia", serif;
  font-size: 0.8rem;
  font-style: italic;
  margin: 0 0 2rem 0;
}

dl, .dl {
  margin: 0 0 2rem 0;
}

dt, .dt {
  display: block;
  font-weight: 600;
  margin: 0 0 1rem 0;
}

dd, .dd {
  margin-left: 2rem;
  line-height: 2.5rem;
}

table {
  width: 100%;
  border-collapse: collapse;
  margin: 0 0 5rem 0;
}

thead {
  font-family: "Source Sans Pro", sans-serif;
  font-size: 0.8rem;
  color: #212931;
  letter-spacing: 0.075em;
  line-height: 1.5;
  text-transform: uppercase;
