// ./silkyCSS/modules/_typos.scss
// CHARGEMENT DES FONTS
@import url('https://fonts.googleapis.com/css2?family=Merriweather:ital,wght@0,300;0,400;0,700;1,300;1,400&display=swap');  // MERRYWHEATHER
@import url('https://fonts.googleapis.com/css2?family=Source+Sans+Pro:wght@900&display=swap');                              // SOURCE SANS PRO

// ------------------------------------------------
// MODULE VARIABLES
// ------------------------------------------------

// ||| FONTS VARIABLES |||||||||| 
// PARAGRAPHES
$font-1:                 'Merriweather', 'Georgia', serif;
$default-color-font:     $color-5;
$default-size-font :     100%;
$default-weight-font:    300;
$default-line-height:    1.65;
$default-letter-spacing: 0.025rem;
$default-text-align:     justify;
// TITLES H1 --> H6
    // H1
    $font-2:            'Source Sans Pro',sans-serif;
    $h1-color-font:     $color-5;
    $h1-size-font :     4rem;
    $h1-weight-font:    300;
    $h1-line-height:    1.2;
    $h1-margin:         0 0.7em 0;
    $h1-letter-spacing: 0.075rem;
    // H2
    $font-2:            'Source Sans Pro', sans-serif;
    $h2-color-font:     $color-5;
    $h2-size-font :     1.75rem;
    $h2-weight-font:    300;
    $h2-line-height:    1.2;
    $h2-margin:         0 0.7em 0;
    $h2-letter-spacing: 0.025rem;
