button,
.button {
  display:     inline-block;
  margin:      $btn-margin;
  transition:  $link-transition;
  font-family: $btn-font;
  & i {
    padding: $btn-icon-padding;
  }
  &.button-primary {
    font-size: $btn-primary-size;
    width:     $btn-primary-width;
    height:    $btn-primary-height;
    &:disabled {
      opacity: $btn-opacity-disabled;
      &:hover {
        background-color: $button-dark-background;
        border:           $color-5;
      }
    }
  }
  &.button-default {
    font-size: $btn-default-size;
    width:     $btn-primary-width;
    height:    $btn-primary-height;

    &:disabled {
      opacity: $btn-opacity-disabled;
      &:hover {
        border-color: $color-5;
        color:        $color-5;
      }
    }
