    font-size: $btn-small-size;
    width:     $btn-small-width;
    height:    $btn-small-height;
  }
  &.button-fit {
    font-size: $btn-fit-size;
    width:     $btn-fit-width;
    height:    $btn-fit-height;
  }
  &.button-fitsmall {
    font-size: $btn-fitsmall-size;
    width:     $btn-fitsmall-width;
    height:    $btn-fitsmall-height;
  }
  &.button-icon {
    font-size:     $btn-icon-size;
    width:         $btn-icon-width;
    height:        $btn-icon-height;
    padding-right: $btn-icon-padding-right;
  }
  &.dark {
    background: $button-dark-background;
    color:      $button-dark-color;
    &:hover {
      background:   $btn-dark-hover-background;
      color:        $button-dark-color;
      border-color: $color-1;
    }
  }
  &.light {
    background: $button-light-background;
    border:     $button-border-color;
    color:      $button-light-color;
    &:hover {
      color:        $button-color-hover;
      border-color: $btn-light-hover-border-color;
    }
  }
