// ./silkyCSS/modules/_forms.scss
// ------------------------------------------------
// MODULE VARIABLES
// ------------------------------------------------
// FORM
$form-margin:        0 0 3rem 0;
$form-display-block: block;

// INPUT TEXT & EMAIL
$input-basic-height:   3rem;
$input-basic-width:   95%;
$input-basic-margin:  0 0 1.3rem 0;
$input-basic-padding: 1rem;
$input-basic-size:    1rem;
$input-basic-border:  2px solid #eeeeee;
// PLACEHOLDER
$input-basic-placeholder-color: #bbbbbb;
$input-basic-font:              $font-1;
// :FOCUS
$input-focus-outline: none;
$input-focus-border:  1px solid $color-1;

// SELECT
$select-width:   97.5%;
$select-height:  3rem;
$select-padding: 0 1rem;
$select-size:    1rem;
$select-font:    $font-1;
$select-color:   $color-5;
$select-border:  2px solid #eeeeee;

// INPUT SUBMIT
$submit-btn-display-block: inline-block;
$submit-btn-font:          $font-2;
$submit-btn-margin:        0.7rem 0.7rem;
$submit-btn-background:    $color-5;
$submit-btn-color:         #fff;
// HOVER
$submit-btn-color-hover: $color-1;

// BTN LIGHT
$submit-btn-light-background: $color-2;
$submit-btn-light-border:     3px solid $color-3;
$submit-btn-light-color:      $color-3;
// HOVER
$submit-btn-hover-light-background: none;
$submit-btn-hover-light-color:      $color-1;
$submit-btn-hover-light-border:     $color-1;
$submit-btn-hover-light-cursor:     pointer;

// TEXT AREA
$textarea-width:         100%;
$textarea-border:        2px solid #eeeeee;
$textarea-border-radius: 0;
$textarea-padding:       1rem 1rem;
$textarea-font-size:     1rem;
$textarea-margin:        0 1rem 1.3rem 0;
// PLACEHOLDER
$textarea-placeholder-color: 100%;
$textarea-placeholder-font:  $font-1;

// BTN SUBMIT
$submit-btn-size:   0.9rem;
$submit-btn-width:  9rem;
$submit-btn-height: 3rem;

// ------------------------------------------------
// MODULE SPECIFICATIONS
// ------------------------------------------------
// FORMULAIRE
form,
.form {
  margin: $form-margin;
  // INPUT

  input {
    // INPUT TEXT EMAIL
    &.form-input-basic {
      height:    $input-basic-height;
      width:     $input-basic-width;
      margin:    $input-basic-margin;
      padding:   $input-basic-padding;
      font-size: $input-basic-size;
      border:    $input-basic-border;
      &::placeholder {
        color:       $input-basic-placeholder-color;
        font-family: $input-basic-font;
      }
      &:focus {
        outline: $input-focus-outline;
        border:  $input-focus-border;
      }
    }

    // INPUT RADIO
    &[type="radio"] {
      width:  25px;
      height: 25px;
      margin: 1rem 0rem 1.5rem 0;

        background-color: red;

    }

    // INPUT CHECKBOX
    &[type="checkbox"] {
      width:  25px;
      height: 25px;
      margin: 1rem 0rem 1.5rem 0;

    }

    // INPUT SUBMIT
    &[type="submit"] {
      display:     inline-block;
      margin:      $submit-btn-margin;
      transition:  $link-transition;
      font-family: $submit-btn-font;

      &.button-submit {
        font-size:  $submit-btn-size;
        width:      $submit-btn-width;
        height:     $submit-btn-height;
        background: $submit-btn-background;
        color:      $submit-btn-color;
        // SUBMIT LIGHT
        &.light {
          background: $submit-btn-light-background;
          border:     $submit-btn-light-border;
          color:      $submit-btn-light-color;
          &:hover {
            background:   $submit-btn-hover-light-background;
            color:        $submit-btn-hover-light-color;
            border-color: $color-1;
            cursor:       pointer;
          }
        }
        &:hover {
          background:   $btn-dark-hover-background;
          color:        $button-dark-color;
          border-color: $submit-btn-hover-light-cursor;
        }
      }
    }
  }

  // SELECT
  select {
    width:       $select-width;
    height:      $select-height;
    padding:     $select-padding;
    font-size:   $select-size;
    font-family: $select-font;
    color:       $select-color;
    border:      $select-border;
    &:focus {
      outline: $input-focus-outline;
      border:  $input-focus-border;
    }
  }

  // TEXT AREA
  textarea {
    width:         $textarea-width;
    border:        $textarea-border;
    border-radius: $textarea-border-radius;
    padding:       $textarea-padding;
    font-size:     $textarea-font-size;
    margin:        $textarea-margin;
    &::placeholder {
      color:       $textarea-placeholder-color;
      font-family: $textarea-placeholder-font;
    }
    &:focus {
      outline: $input-focus-outline;
      border:  $input-focus-border;
    }
  }
}

